// Convert curve params from float32 to U12F

void dogltmConvertCurves()
{
   int curve, point, regoff;
   regoff = 0;
   for (curve = 0; curve < 8; curve++) {
       for (point = 0; point < 16; point += 2) {
           int off = curve + point * 8;
           ltm_curves[off  ] = ispcLtmCurves[off]   * 0xfff; // Convert to U12F
           ltm_curves[off+8] = ispcLtmCurves[off+8] * 0xfff; // Convert to U12F
           regoff += 4;
       }
    }
}

void dogltmCreateLuts ()
{
    u32 idx;

    for (idx = 0; idx < 4; idx++)
    {
        gaussLut[idx] = ispcLumaDnsLut[(idx<< 3) + 0]         |
                        (ispcLumaDnsLut[(idx<< 3) + 1] << 4 ) |
                        (ispcLumaDnsLut[(idx<< 3) + 2] << 8 ) |
                        (ispcLumaDnsLut[(idx<< 3) + 3] << 12) |
                        (ispcLumaDnsLut[(idx<< 3) + 4] << 16) |
                        (ispcLumaDnsLut[(idx<< 3) + 5] << 20) |
                        (ispcLumaDnsLut[(idx<< 3) + 6] << 24) |
                        (ispcLumaDnsLut[(idx<< 3) + 7] << 28);
    }

    gammaLut[0] = ispcGammaLut0_32[0]       | ispcGammaLut0_32[1] <<  8 |
                  ispcGammaLut0_32[2] << 16 | ispcGammaLut0_32[3] << 24;
    gammaLut[1] = ispcGammaLut0_32[4]       | ispcGammaLut0_32[5] <<  8 |
                  ispcGammaLut0_32[6] << 16 | ispcGammaLut0_32[7] << 24;
    gammaLut[2] = ispcGammaLut0_32[8]         | ispcGammaLut32_255[0] << 8 |
                  ispcGammaLut32_255[1] << 16 | ispcGammaLut32_255[2] << 24;
    gammaLut[3] = ispcGammaLut32_255[3]       | ispcGammaLut32_255[4] << 8 |
                  ispcGammaLut32_255[5] << 16 | ispcGammaLut32_255[6] << 24;
    gammaLut[4] = ispcGammaLut32_255[7]       | ispcGammaLut32_255[8] << 8;
}

#define CCVT(f)   ((int)((f) * 1024 + .5) & 0xfff)
#define OCVT(f)   ((int)((f) * 4096 + .5) & 0x1ffff)

void lutCreateLuts ()
{
    u32 idx;

    for (idx = 0; idx < 9; idx++)
    {
        csc_lut_coeffs[idx] = CCVT(ispcCSC[idx]);
    }
    for (idx = 0; idx < 3; idx++)
    {
        csc_lut_offsets[idx] = OCVT(ispcCSCOff[idx]);
    }
}


  #define CCMC(f)   ((int)((f * 0x400)  + .5) & 0xffff) // CCM co-efficients are in S(6,10) format
  #define CCMO(f)   ((int)((f * 0x1000) + .5) & 0x1fff) // CCM offsets are in S(1,12) format

void ccombCreateCoeffs ()
{
    u32 idx;

    for (idx = 0; idx < 9; idx++)
    {
        ccm_lut_coeffs[idx] = CCMC(ispcCCM[idx]);
    }
    for (idx = 0; idx < 3; idx++)
    {
        ccm_lut_offsets[idx] = CCMO(ispcCCMOff[idx]);
    }
}

void ISPPipeCreateParams ()
{
    ccombCreateCoeffs();
    lutCreateLuts ();
    dogltmConvertCurves ();
    dogltmCreateLuts ();
}
